import React, { Fragment } from 'react';

import FormContainer from './loginForm/FormContainer';

const Home = () => {
	return (
		<Fragment>
			<FormContainer />
			<h1>Hi</h1>
			<h2>Hi</h2>
			<h3>Hi</h3>
			<h4>Hi</h4>
			<h5>Hi</h5>
			<h6>Hi</h6>
		</Fragment>
	);
};

export default Home;
